import React, { useState } from "react";

export default ({}) => {
  return (
    <section className="video-cell">

      <img
        src="https://www.pexels.com/photo/aerial-photography-of-snow-covered-trees-1438761/"
        style={{ borderRadius: "30px", width: "500px", height: "300px"}}
      />
    </section>
  );
};
